import {EventEmitter, Injectable} from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  private undeadTransactions:number = 10;
  getUndeadTransactions:EventEmitter<number> = new EventEmitter();

  constructor() {
    this.getUndeadTransactions.emit(this.undeadTransactions);
  }
}
